import { createMuiTheme } from '@material-ui/core/styles';


const theme = createMuiTheme({

    palette: {
        primary: {
            main: '#DD7F2F'
        },
        secondary: {
            main: '#9DCCAC'
        }
    },
    buttonDef: {
        borderRadius: '50px',
        fontFamily: 'Lato',
        height: '40px',
    },
    importantHeader:{
        fontFamily:'Oswald'
    },
    typography:{
        h2:{
            fontSI
        }
    }
});

export default theme
